    try:
        response = requests.get(url, allow_redirects=True)
        return {
            'url': url,
            'status_code': response.status_code,
            'is_valid': response.ok,
            'final_url': response.url,
            'redirects': len(response.history)
        }
    except requests.RequestException as e:
        return {
            'url': url,
            'error': str(e),
            'is_valid': False
        }

