import re
import requests
from xml.etree import ElementTree

sitemap_url = 'http://example.com/sitemap.xml'
response = requests.get(sitemap_url)
sitemap_content = response.content

tree = ElementTree.fromstring(sitemap_content)
namespace = {'ns': 'http://www.sitemaps.org/schemas/sitemap/0.9'}

no_trailing_slash_url = re.compile(r'.*[^/]$')

def check_no_trailing_slash_url(url):
    if no_trailing_slash_url.match(url):
        return True
    else:
        return False

for url_element in tree.findall('ns:url/ns:loc', namespace):
    url = url_element.text
    if check_no_trailing_slash_url(url):
        try:
            url_response = requests.get(url)
            if url_response.status_code == 200:
                print(f"Valid URL: {url}")
            else:
                print(f"Invalid URL (status code {url_response.status_code}): {url}")
        except requests.RequestException as e:
            print(f"Error accessing URL {url}: {e}")
    else:
        print(f"URL with trailing slash: {url}")

