import re
from bs4 import BeautifulSoup
import requests

ghost_url = "https://old-ghost-blog.com"
new_blog_url = "https://new-blog.com"

asset_url_regex = re.compile(r'^https://old-ghost-blog\.com/content/images/')

def export_content(url):
    response = requests.get(url)
    if response.status_code == 200:
        return response.text
    else:
        raise Exception("Failed to fetch content from Ghost blog")

def import_content(url, content):
    response = requests.post(url, data={'content': content})
    if response.status_code == 200:
        return response.json()
    else:
        raise Exception("Failed to import content to new blog")

def migrate_assets(html):
    soup = BeautifulSoup(html, 'html.parser')

    for img in soup.find_all('img'):
        if asset_url_regex.match(img['src']):
            img['src'] = img['src'].replace(ghost_url, new_blog_url)

    return str(soup)

def migrate_blog(ghost_export_url, new_blog_import_url):
    content = export_content(ghost_export_url)
    updated_content = migrate_assets(content)
    import_content(new_blog_import_url, updated_content)

# Example usage
ghost_export_url = "https://old-ghost-blog.com/export"
new_blog_import_url = "https://new-blog.com/import"
migrate_blog(ghost_export_url, new_blog_import_url)

