import os
import glob
import time

def clean_old_temp_files(directory, days_old):
    now = time.time()
    cutoff = now - (days_old * 86400)

    for filepath in glob.glob(os.path.join(directory, '*')):
        if os.path.isfile(filepath) and os.path.getctime(filepath) < cutoff:
            os.remove(filepath)

